        // RobinsG - 22.ago.2025 - Ajusteo Metodo Para HTTPS NET 8.0
        private static System.ServiceModel.Channels.Binding GetBindingForEndpoint(EndpointConfiguration endpointConfiguration)
        {
            if (endpointConfiguration == EndpointConfiguration.FacturacionWebServicePort)
            {
                var result = new System.ServiceModel.BasicHttpsBinding();

                // ⚡ Necesario para HTTPS
                result.Security = new System.ServiceModel.BasicHttpsSecurity
                {
                    Mode = System.ServiceModel.BasicHttpsSecurityMode.Transport
                };

                // 📦 Configuración adicional
                result.MaxBufferSize = int.MaxValue;
                result.MaxReceivedMessageSize = int.MaxValue;
                result.ReaderQuotas = System.Xml.XmlDictionaryReaderQuotas.Max;
                result.AllowCookies = true;

                return result;
            }

            throw new System.InvalidOperationException(
                $"No se pudo encontrar un punto de conexión con el nombre \"{endpointConfiguration}\".");
        }


        private static System.ServiceModel.EndpointAddress GetEndpointAddress(EndpointConfiguration endpointConfiguration)
        {
            if ((endpointConfiguration == EndpointConfiguration.FacturacionWebServicePort))
            {
                //return new System.ServiceModel.EndpointAddress("https://portal.myeinvoice.co/CompunetWebService/FacturacionWebService"); //Prodcution.
                return new System.ServiceModel.EndpointAddress("https://habilitacion-myeinvoice.avance.org.co/CompunetWebService/FacturacionWebService"); //Development.
            }
            throw new System.InvalidOperationException(string.Format("No se pudo encontrar un punto de conexión con el nombre \"{0}\".", endpointConfiguration));
        }
        
        private static System.ServiceModel.Channels.Binding GetDefaultBinding()
        {
            return FacturacionWebServiceClient.GetBindingForEndpoint(EndpointConfiguration.FacturacionWebServicePort);
        }
        
        private static System.ServiceModel.EndpointAddress GetDefaultEndpointAddress()
        {
            return FacturacionWebServiceClient.GetEndpointAddress(EndpointConfiguration.FacturacionWebServicePort);
